@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Medicina Inmersiva';
}

<!doctype html>
<html lang="en" data-bs-theme="auto">
